import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from 'react-router-dom';
import Home from './Screens/Home';


function App() {
  return (

    <Router>
      <Routes>
      <Route exact path='/' element={<Home />} />
      </Routes>
    </Router>
  );
}
export default App;
